  axios({
      method: 'GET',
      url: '/userInfo',
      headers: {
          Authorization: `Bearer ${token}` // Bearer 토큰을 "Authorization" 헤더에 추가
      }
  })
      .then(response => {
          setData(response.data);
          setShowDetails(true);
          console.log('성공:', response.data);

